(require 'htm-mnist.core :reload)
(require 'htm-mnist.gabor :reload)

(defn mnist-inputs
  [images-file labels-file n]
  (map (fn [img-bytes lab]
         {:img-bytes img-bytes
          :label lab})
       (mnist/read-mnist-images images-file n)
       (mnist/read-mnist-labels labels-file)))

(defn train-inputs
  [n]
  (mnist-inputs "public/data/train-images-idx3-ubyte"
                "public/data/train-labels-idx1-ubyte"
                n))

(defn test-inputs
  [n]
  (mnist-inputs "public/data/test-images-idx3-ubyte"
                "public/data/test-labels-idx1-ubyte"
                n))

