;; **
;;; ### Vision sensing
;; **

;; @@
(def thetas
  [0
   (* Math/PI 1/4)
   (* Math/PI 1/2)
   (* Math/PI 3/4)])

(def gf-size 11)
(def gf-pad (quot gf-size 2))

(def gf-specs
  (for [theta thetas
        phase [0 0.5 -0.5]
        :let [asp (if (zero? phase) 0.25 1.0)]]
    {:wavelength 5
     :orientations [theta]
     :bandwidth 2
     :aspect-ratio asp
     :phase-offset (* phase Math/PI)
     :width gf-size
     :height gf-size}))

(def gf-bank
  (map gabor/gabor-filter gf-specs))

(table-view
  (cons
    ;; table column headers
    (cons
      "Gabor filters"
      (for [gf gf-bank]
        (<img> (gabor/gabor-kernel-image gf) (* gf-size 3)))
      )
    (for [inval (train-inputs 8)
         :let [img (imgs/bytes->image (:img-bytes inval) [28 28] gf-pad)]]
      (cons
        (<img> img 84)
        (for [gf gf-bank]
          (<img> (gabor/gaborize img gf) 84))
        )
     ))
   )

