(require '[htm-mnist.encoders :as mnist-enc] :reload)

(def debug-gabor-encoder
  (mnist-enc/gabor-encoder [28 28] gf-specs
                          {:threshold 100
                           :force-2d? true}))

(def gabor-encoder
  (mnist-enc/gabor-encoder [28 28] gf-specs
                          {:threshold 100}))

(def idx-gabor-encoder
  (e/no-encoder [28 28 (count gf-specs)]))

(table-view
  (for [inval (train-inputs 8)]
   [(table-view
      (for [gf gf-bank]
       [(<img> (gabor/gaborize
                 (imgs/bytes->image (:img-bytes inval) [28 28] gf-pad) gf)
               84)]
     ))
    (viz gabor-encoder (:img-bytes inval) {:max-height-px 2000, :bit-h-px 4, :bit-w-px 4})
    (<img> (imgs/bytes->image (:img-bytes inval) [28 28] 0) 84)
    (let [inbits (p/encode gabor-encoder (:img-bytes inval))]
       (<img> (reconstruct-image gabor-encoder (zipmap inbits (repeat 1)) [28 28])
              84 "#44ff44"))
    ;(viz debug-gabor-encoder (:img-bytes inval) {:bit-h-px 24, :bit-w-px 2})
    ])
