;; **
;;; ## Classification setup
;; **

;; @@
(def test-inputs-2k
  (take-last 2000 (train-inputs (+ 15000 2000))))

(def test-inputs-1k
  (take 1000 test-inputs-2k))

;; @@
;; ->
;;; read 13328016 bytes
;;; file has 60000 images at 28 x 28
;;; file has 60000 labels
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/test-inputs-1k</span>"}
;; <=

;; **
;;; ## Classification directly on input bits
;; **

;; @@
(require '[htm-mnist.classification :as clas] :reload)

(def classif-spec
  (->
    (clas/classification-layer-spec
      (zipmap (range 10) (range 10)))
    (util/deep-merge
      {:proximal {:perm-inc 0.04
                  :perm-dec 0.01
                  :punish? false
                  }})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/classif-spec</span>"}
;; <=

;; @@
(def inbits-classif-spec
  classif-spec)

(def clas-model
  (core/regions-in-series
    1 core/sensory-region
    [inbits-classif-spec]
    {:input [:img-bytes thresh-encoder]}))

(time
  (def clas-trained-1k
    (reduce clas/htm-step-with-label clas-model (train-inputs 1000))))

;; @@
;; ->
;;; Warning: unknown keys in spec: #{:classification}
;;; read 784016 bytes
;;; file has 60000 images at 28 x 28
;;; file has 60000 labels
;;; &quot;Elapsed time: 1029.414034 msecs&quot;
;;; 
;; <-
