;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/clas-trained-1k</span>"}
;; <=

;; @@
(def clas-sh-model
  (core/regions-in-series
    1 core/sensory-region
    [inbits-classif-spec]
    {:input [:img-bytes shade-encoder]}))

(time
  (def clas-sh-trained-1k
    (reduce clas/htm-step-with-label clas-sh-model (train-inputs 1000))))
