;; <=

;; @@
(defn classif-connected-synapses-plot
  [htm]
  (let [clyr (-> htm (core/region-seq) (last) :layer-3)
      sg (:proximal-sg clyr)
      max-segs (:max-segs sg)
      cols (range (p/size-of clyr))
      conns
      (for [col cols]
        (->> (for [si (range max-segs)]
               (p/sources-connected-to sg [col 0 si]))
             (map count)
             (reduce +)))]
  (plot/bar-chart cols conns :plot-size 140)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/classif-connected-synapses-plot</span>"}
;; <=

;; @@
[(classif-connected-synapses-plot clas-trained-1k)
 (classif-connected-synapses-plot clas-sh-trained-1k)
 ]
