;; **
;;; ### Multiple proximal segments
;; **

;; @@
(def classifm-spec
  (->
    (clas/classification-layer-spec
      (zipmap (range 10) (range 10)))
    (util/deep-merge
      {:ff-init-frac 1.0
       :proximal {:perm-inc 0.03
                  :perm-dec 0.01
                  :perm-punish 0.005
                  :punish? true
                  :max-segments 5
                  :max-synapse-count 80
                  :grow? true
                  :new-synapse-count 40
                  :learn-threshold 20
                  :stimulus-threshold 30}})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/classifm-spec</span>"}
;; <=

;; @@
(def clasm-model
  (core/regions-in-series
    1 core/sensory-region
    [classifm-spec]
    {:input [:img-bytes thresh-encoder]}))

(time
  (def clasm-trained-1k
    (reduce clas/htm-step-with-label clasm-model (train-inputs 1000))))

