;; **
;;; ## HTM model - no training
;; **

;; @@
(def static-spec
  {:column-dimensions [2000]
   :activation-level 0.02
   :depth 1
   :lateral-synapses? false
   :distal {:learn? false}
   :proximal {:learn? false}})

(def classifm2-spec
  (util/deep-merge
    classifm-spec
    {:proximal {:perm-inc 0.04
                :perm-dec 0.01
                :stimulus-threshold 5
                :learn-threshold 5
                :new-synapse-count 20}}))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/classifm2-spec</span>"}
;; <=

;; @@
(def static-model
  (core/regions-in-series
   2 core/sensory-region
   [static-spec classifm2-spec]
   {:input [:img-bytes thresh-encoder]}))

;; training classification layer
(time
  (def static-trained-1k
    (reduce clas/htm-step-with-label static-model (train-inputs 1000))))

