    (for [col (range 10)]
      (let [inbits (keys (core/segs-proximal-bit-votes clyr [[col 0 seg-idx]]))]
        (if inbits
          (viz idx-thresh-encoder inbits {:bit-w-px 2, :bit-h-px 2})
          '-)))))
)
