;; **
;;; ## HTM model - no training - KNN classifier
;; **

;; @@
;; 6% activation to reproduce Numenta's result:
;; https://github.com/numenta/nupic.vision/blob/82a844b6b02a17848659b4107960dec2fe807a81/nupic/vision/mnist/run_mnist_experiment.py#L53

(def static-k-spec
  {:column-dimensions [2000]
   :activation-level 0.06
   :depth 1
   :lateral-synapses? false
   :distal {:learn? false}
   :proximal {:learn? false}})
;; @@

;; @@
(def static-k-model
  (core/regions-in-series
   1 core/sensory-region
   [static-k-spec]
   {:input [:img-bytes thresh-encoder]}))
;; @@

;; @@
(defn build-knn-classifier
  [model invals]
  (loop [invals invals
         htm model
         m {}]
    (if-let [inval (first invals)]
      (let [htma (-> htm
                     (p/htm-sense inval nil)
                     (p/htm-activate))
            lyr (-> (core/region-seq htma) (first) :layer-3)
            sdr (p/active-columns lyr)]
        (recur (next invals)
               htm
               (assoc m sdr (:label inval))))
      ;; done
      {:model htm
       :sdr-labels m})
    ))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/build-knn-classifier</span>"}
;; <=

;; @@
(time
  (def knn-1k (build-knn-classifier static-k-model (train-inputs 1000)))
  )

