;; @@
(defn hamming-dist
  [s1 s2]
  (count
    (set/difference (set/union s1 s2)
                    (set/intersection s1 s2))))

(defn knn-classify
  [knn inval]
  (let [htm (:model knn)
        htma (-> htm
                 (p/htm-sense inval nil)
                 (p/htm-activate))
        lyr (-> (core/region-seq htma) (first) :layer-3)
        sdr (p/active-columns lyr)
        dist hamming-dist]
    (second (apply min-key
                   (fn [[ref-sdr _]] (dist ref-sdr sdr))
                   (:sdr-labels knn)))))

(defn knn-confusion
  [knn invals]
  (frequencies
    (map (fn [inval]
           [(:label inval)
            (knn-classify knn inval)])
         invals)))

