;; **
;;; ## KNN directly on encoded inbits
;; **

;; @@
(defn build-knn-classifier-inbits
  [sensor invals]
  (loop [invals invals
         m {}]
    (if-let [inval (first invals)]
      (let [[selector encoder] sensor
            sdr (set (p/encode encoder (p/extract selector inval)))]
        (recur (next invals)
               (assoc m sdr (:label inval))))
      ;; done
      {:sensor sensor
       :sdr-labels m})
    ))

(defn knn-classify-inbits
  [knn inval]
  (let [sensor (:sensor knn)
        [selector encoder] sensor
        sdr (set (p/encode encoder (p/extract selector inval)))
        dist hamming-dist]
    (second (apply min-key
                   (fn [[ref-sdr _]] (dist ref-sdr sdr))
                   (:sdr-labels knn)))))

(defn knn-confusion-inbits
  [knn invals]
  (frequencies
    (map (fn [inval]
           [(:label inval)
            (knn-classify-inbits knn inval)])
         invals)))

