;; **
;;; ## HTM model - single layer global
;; **

;; @@
(def spec
  {:column-dimensions [1000]
   :depth 1
   :lateral-synapses? false
   :distal {:learn? false}
   :ff-init-frac 0.25
   :proximal {:perm-inc 0.01
              :perm-dec 0.01}})

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/spec</span>"}
;; <=

;; @@
(def model (core/regions-in-series
            2 core/sensory-region
            [spec classifm2-spec]
             {:input [:img-bytes thresh-encoder]}))

(time
  (def trained-1k
    (reduce clas/htm-step-with-label model (train-inputs 1000))))

