;; @@
(defn class-receptive-field-table
  [htm viz-inbits]
  (table-view
  (let [lyr (get-in htm [:regions :rgn-0 :layer-3])
        clyr (get-in htm [:regions :rgn-1 :layer-3])]
  (for [seg-idx (range 5)]
    (for [col (range 10)]
      (let [incols (keys (core/segs-proximal-bit-votes clyr [[col 0 seg-idx]]))]
        (if incols
          (let [inbits (->> (core/cells-proximal-bit-votes lyr (map vector incols (repeat 0)))
                            (sort-by val >)
                            (keys)
                            (take 100))]
            (viz-inbits inbits)
            )
          '-))))))
  )
