;; **
;;; Step through some inputs and trace the activation and learning.
;;; 
;;; * which columns activated - show receptive fields
;;;   - show closest few non-activated columns
;;; * which classification segments were activated / stimulated
;;; * which synapses changed
;; **

;; @@
  #_(<img> (reconstruct-image thresh-encoder (zipmap inbits (repeat 1)) [28 28])
         56 "#44ff44")

(table-view
(loop [invals (take 2 test-inputs-2k)
       htm trained-1k
       out []]
   (if-let [inval (first invals)]
     (let [this-htm (-> htm
                        (p/htm-sense inval nil)
                        (p/htm-activate))
           lyr (-> (core/region-seq this-htm) (first) :layer-3)
           psg (:proximal-sg lyr)
           a-cols (p/active-columns lyr)
           overlaps* (get-in lyr [:state :col-overlaps])
           overlaps (into (sorted-map) (map (fn [[[col _] o]] [col o])) overlaps*)
           #_(zipmap (keys overlaps)
                        (map (fn [[col o]]
                         (p/sources-connected-to psg [col 0 0]))
                             overlaps))
           clyr (-> (core/region-seq this-htm) (last) :layer-3)
           coverlaps* (get-in clyr [:state :col-overlaps])
           coverlaps (into (sorted-map) (map (fn [[[col _] o]] [col o])) coverlaps*)
           
           img (imgs/bytes->image (:img-bytes inval) [28 28] gf-pad)]
       (recur
         (next invals)
         htm
         (conj
           out
           [(<img> img 84)
         (:label inval)
            (map (fn [col]
                   (let [rf (p/sources-connected-to psg [col 0 0])]
                     [(overlaps col) (viz-inbits rf)])
                   )
                 (sort-by overlaps > a-cols))
         ])))
     ;; done
     out
      ))
)
