;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/reconstruction-error-table</span>"}
;; <=

;; @@
(defn viz-inbits
  [inbits]
  (<img> (reconstruct-image thresh-encoder (zipmap inbits (repeat 1)) [28 28])
         56))

(reconstruction-error-table
  trained-15k
  (take 6 test-inputs-2k)
  viz-inbits)
