;; @@
(def clas-periments
  [{}
   {:ff-init-frac 0.5}
   {:proximal {:perm-inc 0.04, :perm-dec 0.01}}
   {:proximal {:perm-inc 0.02, :perm-dec 0.01}}
   {:proximal {:perm-inc 0.01, :perm-dec 0.01}}
   {:proximal {:perm-inc 0.01, :perm-dec 0.02}}
   {:proximal {:perm-punish 0.001}}
   {:proximal {:perm-punish 0.01}}
   {:proximal {:punish? false}}
   {:proximal {:max-segments 3}}
   {:proximal {:max-segments 10}}
   {:proximal {:max-synapse-count 100}}
   {:proximal {:max-synapse-count 40}}
   {:proximal {:new-synapse-count 60}}
   {:proximal {:new-synapse-count 20}}
   {:proximal {:learn-threshold 10}}
   {:proximal {:learn-threshold 30}}
   {:proximal {:stimulus-threshold 10}}
   {:proximal {:stimulus-threshold 40}}])

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/clas-periments</span>"}
;; <=

;; @@
(defn run-experiments-15k
  [encoder base-spec base-cspec & {:keys [sp-expms clas-expms]}]
  (let [train-1k (train-inputs 1000)
        train-15k (train-inputs 15000)]
    (assert (or sp-expms clas-expms))
    (assert (not (and sp-expms clas-expms)))
    (doall
    (for [expm (or sp-expms clas-expms)]
      (let [this-spec (if sp-expms
                        (util/deep-merge base-spec expm)
                        base-spec)
            this-cspec (if clas-expms
                         (util/deep-merge base-cspec expm)
                         base-cspec)
            model (core/regions-in-series
                   2 core/sensory-region
                   [this-spec this-cspec]
                   {:input [:img-bytes encoder]})
            _ (println expm)
            htm-1k (reduce clas/htm-step-with-label model train-1k)
            _ (print "1k: ")
            err-1k (classification-error (confusion htm-1k test-inputs-2k))
            _ (println err-1k)
            htm-15k (reduce clas/htm-step-with-label htm-1k (drop 1000 train-15k))
            _ (print "15k: ")
            err-15k (classification-error (confusion htm-15k test-inputs-2k))
            _ (println err-15k)
            ]
        [expm
         err-1k
         err-15k
         ]
        )))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/run-experiments-15k</span>"}
;; <=

;; @@
(time
  (def clas-periment-results
    (run-experiments-15k thresh-encoder spec classifm2-spec
                         :clas-expms clas-periments)))

