(def pun-model
  (core/regions-in-series
   2 core/sensory-region
   [pun-spec classifm2-spec]
   {:input [:img-bytes thresh-encoder]}))

(time
 (def pun-trained-1k
   (reduce clas/htm-step-with-label pun-model (train-inputs 1000))))
