;; **
;;; ## HTM model - direct, single layer, local
;; **

;; @@
(def loc-spec
  {:column-dimensions [30 30]
   :spatial-pooling :local-inhibition
   :inhibition-base-distance 2
   :ff-potential-radius (float (/ 5 28))
   :ff-init-frac 1.0
   :depth 1
   :lateral-synapses? false
   :distal {:learn? false}
   :proximal {:perm-inc 0.01
              :perm-dec 0.01
              :stimulus-threshold 15
              :learn-threshold 7}

   ;:boost-active-duty-ratio 0 ;1/50
   :adjust-overlap-duty-ratio 0
   ;:float-overlap-duty-ratio 0
   :float-overlap-every 200
   })
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/loc-spec</span>"}
;; <=

;; @@
(def loc-model
  (core/regions-in-series
    2 core/sensory-region
    [loc-spec classifm2-spec]
    {:input [:img-bytes thresh-encoder]}))

(time
  (def loc-trained-1k
    (reduce clas/htm-step-with-label loc-model (train-inputs 1000))))
