;; @@
(let [lyr (get-in shloc-trained-15k [:regions :rgn-0 :layer-3])]
  (for [col (->> (range 20) (map #(* % 900/20)))]
    (let [inbits (keys (core/cells-proximal-bit-votes lyr [[col 0]]))]
      (viz idx-shade-encoder inbits {:bit-w-px 2, :bit-h-px 2}))))
