;; **
;;; ## HTM model - gabor, single layer, local
;; **

;; @@
(def gabloc-spec
  (util/deep-merge
    loc-spec
    {:proximal {:perm-inc 0.02
                :perm-dec 0.01
                :stimulus-threshold 7
                :learn-threshold 4}}))

(def gabloc-model
  (core/regions-in-series
   2 core/sensory-region
   [gabloc-spec classifm2-spec]
    {:input [:img-bytes gabor-encoder]}))
;; @@
;; ->
;;; Warning: unknown keys in spec: #{:classification}
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/gabloc-model</span>"}
;; <=

;; @@
(time
  (def gabloc-trained-1k
    (reduce clas/htm-step-with-label gabloc-model (train-inputs 1000))))
