;; @@
(table-view
(let [lyr (get-in gabloc-trained-15k [:regions :rgn-0 :layer-3])
      clyr (get-in gabloc-trained-15k [:regions :rgn-1 :layer-3])]
  (for [seg-idx (range 5)]
    (for [col (range 10)]
      (let [incols (keys (core/segs-proximal-bit-votes clyr [[col 0 seg-idx]]))]
        (if incols
          (let [inbits (->> (core/cells-proximal-bit-votes lyr (map vector incols (repeat 0)))
                            (sort-by val >)
                            (keys)
                            (take 100))
                votes (core/cells-proximal-bit-votes lyr (map vector incols (repeat 0)))
                ;votes (zipmap inbits (repeat 1))
                ]
            (<img> (reconstruct-image gabor-encoder votes [28 28])
              60 "#44ff44")
            #_(viz idx-gabor-encoder inbits {:bit-w-px 2, :bit-h-px 2})
            )
          '-)))))
)
