;; <=

;; **
;;; ## HTM model - direct, single layer, global + SLI
;;; 
;;; Subtractive Lateral Inhibition
;; **

;; @@
(def sli-spec
  (util/deep-merge
   spec
   {:spatial-pooling ::al/suck-decorrelation
    :suck-alpha 1.0
    :proximal {:perm-inc 0.01
               :perm-dec 0.01}
    :boost-active-duty-ratio 0
    :adjust-overlap-duty-ratio 0
    }))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/sli-spec</span>"}
;; <=

;; @@
(def sli-model
  (core/regions-in-series
    2 core/sensory-region
    [sli-spec classifm2-spec]
    {:input [:img-bytes thresh-encoder]}))

(time
  (def sli-trained-1k
    (reduce clas/htm-step-with-label sli-model (train-inputs 1000))))
