;; **
;;; ## HTM model - direct, single layer, global + HLI
;;; 
;;; Hebbian Lateral Inhibition
;; **

;; @@
(def hli-spec
  (util/deep-merge
   spec
   {:spatial-pooling ::al/lateral-inhibition
    :inhibition-alpha 1.0
    :activation-level 0.02
    :ilateral {:learn? true}
    :boost-active-duty-ratio 0
    :adjust-overlap-duty-ratio 0
}))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/hli-spec</span>"}
;; <=

;; @@
(def hli-model
  (core/regions-in-series
    2 core/sensory-region
    [hli-spec classifm2-spec]
    {:input [:img-bytes thresh-encoder]}))

(time
  (def hli-trained-1k
    (reduce clas/htm-step-with-label hli-model (train-inputs 1000))))
