;; **
;;; ## HTM model - direct, single layer, local + SLI
;;; 
;;; Subtractive Lateral Inhibition
;; **

;; @@
(def sli-loc-spec
  (util/deep-merge
   loc-spec
   {:spatial-pooling ::al/suck-decorrelation
    :suck-alpha 1.0
    :proximal {:perm-inc 0.01
               :perm-dec 0.01}
    :boost-active-duty-ratio 0
    :adjust-overlap-duty-ratio 0
    }))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/sli-loc-spec</span>"}
;; <=

;; @@
(def sli-loc-model
  (core/regions-in-series
    2 core/sensory-region
    [sli-loc-spec classifm2-spec]
    {:input [:img-bytes thresh-encoder]}))

(time
  (def sli-loc-trained-1k
    (reduce clas/htm-step-with-label sli-loc-model (train-inputs 1000))))
