;; @@
(let [lyr (get-in sli-loc-trained-15k [:regions :rgn-0 :layer-3])]
  (for [col (->> (range 20) (map #(* % 900/20)))]
    (let [inbits (keys (core/cells-proximal-bit-votes lyr [[col 0]]))]
      (viz idx-thresh-encoder inbits {:bit-w-px 2, :bit-h-px 2}))))
;; @@

;; @@
(table-view
 (let [lyr (get-in sli-loc-trained-15k [:regions :rgn-0 :layer-3])
       clyr (get-in sli-loc-trained-15k [:regions :rgn-1 :layer-3])]
   (for [seg-idx (range 5)]
     (for [col (range 10)]
       (let [incols (keys (core/segs-proximal-bit-votes clyr [[col 0 seg-idx]]))]
         (if incols
           (let [inbits (->> (core/cells-proximal-bit-votes lyr (map vector incols (repeat 0)))
                             (sort-by val >)
                             (keys)
                             (take 100))]
             (viz idx-thresh-encoder inbits {:bit-w-px 2, :bit-h-px 2})
             )
           '-)))))
 )
