;; **
;;; ## HTM model - direct, single layer, local + HLI
;;; 
;;; Hebbian Lateral Inhibition
;; **

;; @@
(def hli-loc-spec
  (util/deep-merge
   loc-spec
   {:spatial-pooling ::al/lateral-inhibition
    :inhibition-alpha 1.0
    :activation-level 0.04
    :ilateral {:learn? true}
    :boost-active-duty-ratio 0
    :adjust-overlap-duty-ratio 0
}))

