(def hli-loc-model
  (core/regions-in-series
    2 core/sensory-region
    [hli-loc-spec classifm2-spec]
    {:input [:img-bytes thresh-encoder]}))

(time
  (def hli-loc-trained-1k
    (reduce clas/htm-step-with-label hli-loc-model (train-inputs 1000))))
